import axios from 'axios';

const Period = async (page, limit) => {
  try {
    const response = await axios.get(`/items?page=${page}&limit=${limit}`);
    return response.data;
  } catch (error) {
    console.error("Error fetching items:", error);
    throw error;
  }
};
